import React, { Component } from "react";
import "./App.css";

const charts = [
  {
    date: 1984,
    country: "UK",
    songs: [
      { name: "do be do", artist: "kylie" },
      { name: "song 2", artist: "danni" },
    ],
  },
];

const Charts = () => (
  <div>
    <h3>Surfboards Component</h3>
  </div>
);

class App extends Component {
  render() {
    return (
      <div className="App">
        App Container
        <Charts charts={charts} />
      </div>
    );
  }
}

export default App;
